import { Link } from "react-router-dom";

function Header() {
  return (
    <div className="flex h-14 bg-blue-300 justify-around">
      <div className="Logo">
        <span>LOGO</span>
      </div>
      <div className="Auth"></div>
      <div className="Shopping">
        <div>
          <img
            src="/frontend/public/images/shopping-cart.png"
            width="32"
            alt=""
          />
        </div>
      </div>
    </div>
  );
}

export default Header;
